import{_ as e,a,o as t,aj as r}from"./chunks/framework.Ba_Ek9Jm.js";const o="/assets/147425072977750.CFGgNH1l.png",l="/assets/147442839612291.BS1JF-B5.png",s="/assets/147442839612291.BS1JF-B5.png",i="/assets/147485420263708.B8pVjvZk.png",u="/assets/147519349878875.Doe6Hb-S.png",n="/assets/147540161512375.Cxy_6dPb.png",j=JSON.parse('{"title":"Midjourney 艺术家风格：拉斐尔·阿尔伯克基（Rafael Albuquerque）","description":"","frontmatter":{"title":"Midjourney 艺术家风格：拉斐尔·阿尔伯克基（Rafael Albuquerque）","date":"2023-05-29T00:00:00.000Z","tags":["ai","ml","midjourney-style"],"category":["AI"]},"headers":[],"relativePath":"posts/2023/05/2023-05-29-midjourney-Rafael-Albuquerque.md","filePath":"posts/2023/05/2023-05-29-midjourney-Rafael-Albuquerque.md","lastUpdated":1718175555000}'),p={name:"posts/2023/05/2023-05-29-midjourney-Rafael-Albuquerque.md"},d=r('<p>拉斐尔·阿尔伯克基出生于巴西阿雷格里港。自 2005 年以来，他一直在美国漫画行业工作。他因《全明星蝙蝠侠》、《动物人》和《蝙蝠女》而闻名， 还出版了创作者拥有的书籍《Mondo Urbano》（2010 年）、《Eight》（2015 年）和《Eight》（2015 年）。</p><blockquote><p>部分图片遗失，使用官网图片示例</p></blockquote><p><img src="'+o+'" alt=""></p><p>拉斐尔凭借斯科特·施奈德和史蒂芬·金撰写的《纽约时报》畅销书《美国吸血鬼》 （DC 漫画/迷魂记，2010 年）获得艾斯纳奖、哈维奖和 Inkpot 奖。 他即将推出的项目包括改编尼尔·盖曼的热门小说《翡翠的研究》和马克·米勒的《Hit-Girl》。</p><p><img src="'+l+'" alt=""></p><h2 id="midjourney-作品" tabindex="-1">Midjourney 作品 <a class="header-anchor" href="#midjourney-作品" aria-label="Permalink to &quot;Midjourney 作品&quot;">​</a></h2><p>Albuquerque 的作品以其强烈的视觉风格和对暴力和犯罪的探索而闻名。 他也被认为是美国漫画中少数几个有影响力的拉丁美洲艺术家之一。</p><p><img src="'+s+'" alt="v5.2"></p><p><img src="'+i+'" alt="v5.1"></p><p>除了他的漫画工作外，Albuquerque 还为各种其他媒体创作艺术作品，包括电影、电视和音乐。 他还举办了个人展览，他的作品被收藏在许多博物馆和私人收藏中。</p><h2 id="v5-0" tabindex="-1">v5.0 <a class="header-anchor" href="#v5-0" aria-label="Permalink to &quot;v5.0&quot;">​</a></h2><p>Rafael Albuquerque 的作品风格以其强烈的视觉风格和对暴力和犯罪的探索而闻名。 他的线条粗犷而有力，色彩鲜艳而令人印象深刻。</p><p><img src="'+u+'" alt=""></p><p>他的人物通常被描绘成凶狠而野蛮的，他的背景通常是阴暗而危险的。</p><h2 id="v4" tabindex="-1">v4 <a class="header-anchor" href="#v4" aria-label="Permalink to &quot;v4&quot;">​</a></h2><p>Albuquerque 的作品风格受到了许多不同艺术家的影响，包括墨西哥艺术家弗里达·卡洛、美国艺术家杰克·科尔森和德国表现主义艺术家埃里希·赫克尔。 他也受到电影、电视和音乐的启发。</p><h2 id="niji-5" tabindex="-1">niji 5 <a class="header-anchor" href="#niji-5" aria-label="Permalink to &quot;niji 5&quot;">​</a></h2><p>Albuquerque 的作品风格独特而引人注目，他被认为是当代最有才华的漫画艺术家之一。 他的作品受到了世界各地的读者的喜爱，他也被认为是美国漫画中少数几个有影响力的拉丁美洲艺术家之一。</p><p><img src="'+n+'" alt=""></p><h2 id="资料" tabindex="-1">资料 <a class="header-anchor" href="#资料" aria-label="Permalink to &quot;资料&quot;">​</a></h2><ul><li><a href="https://rafaelalbuquerque.com/about/" target="_blank" rel="noreferrer">https://rafaelalbuquerque.com/about/</a></li><li><a href="https://www.midlibrary.io/styles/rafael-albuquerque" target="_blank" rel="noreferrer">https://www.midlibrary.io/styles/rafael-albuquerque</a></li></ul><hr><div style="text-align:center;color:#00000099;font-size:14px;">END</div>',23),c=[d];function _(q,h,m,b,f,g){return t(),a("div",null,c)}const v=e(p,[["render",_]]);export{j as __pageData,v as default};
